02_getting_started/examples/chatbot/chat.body:
Chatbot - Anleitung für Programmierer
Es liegt im Aufgabenbereich des Softwareentwicklers, die benötigten
Dienste für das Diagramm bereitzustellen.
Prozessmodellierer können ExternalTasks in den Diagrammen verwenden um
auf Dienste der Softwareentwickler zuzugreifen. Doch damit dies
möglichst ist, müssen zunächst diese Dienste bereitgestellt werden.
In diesem Beispiel wird ein minimaler Task definiert und registriert.
Von Seiten der Prozessmodellierung kommen folgende Anforderungen:

der Task soll unter dem Topic Chatbot verfügbar sein,
als Payload erhält der Task die menschliche Nutzereingabe,
auf diese Eingabe reagiert der Chatbot,
der Chatbot soll eine Antwort generieren und zurückgeben.

Das vorgestellte Programm steht
hier
startbereit zur Verfügung.
Voraussetzung
Um das Projekt ausführen zu können, muss die
JavaScript-Lauftzeitumgebung nodejs installiert sein.
Projekt aufsetzen
Zunächst muss ein Projekt erstellt werden mit dem Befehl: npm init.
Auf dem Projektpfad müssen die benötigten Programmbibliotheken
installiert werden:
npm i --save elizabot @essential-projects/http @process-engine/external_task_api_client @process-engine/external_task_api_contracts
Es muss eine JavaScript-Datei erstellt werden, etwa mit dem Namen chatbot.js.
Programmcode
Im Folgenden wird der Programmcode vorgestellt.
Import-Anweisungen
Zunächst werden die zuvor installierten Bibliotheken importiert.
const Chatbot = require('elizabot');
const {HttpClient} = require('@essential-projects/http');
const {
  ExternalTaskApiClientService,
  ExternalTaskApiExternalAccessor,
  ExternalTaskWorker,
} = require('@process-engine/external_task_api_client');
const {
  ExternalTaskFinished,
} = require('@process-engine/external_task_api_contracts');

Die eigentliche Funktionalität des Chatbots programmieren wir nicht
selber und verwenden stattdessen
elizabot.
Die anderen Bibliotheken dienen dem Registrieren des ExternalTasks.
Erstellung des HttpClients
Der HttpClient wird benutzt um die technische Schicht der
Kommunikation zu gewährleisten.
const httpClient = new HttpClient();
httpClient.config = {
  url: 'http://localhost:8000',
}

Wir erstellen eine Instanz des HttpClient und konfigurieren die
Adresse, unter welcher die ProcessEngine erreichbar ist. Wenn auf
demselben Rechner das BPMN-Studio gestartet wird, steht die
ProcessEngine unter http://localhost:8000 zur Verfügung.
ExternalAccessor / ExternalTaskAPIService / ExternalTaskWorker
const externalAccessor = new ExternalTaskApiExternalAccessor(httpClient);
const externalTaskAPIService = new ExternalTaskApiClientService(externalAccessor);
const externalTaskWorker = new ExternalTaskWorker(externalTaskAPIService);

Wir erstellen einen externen Accessor, welcher den zuvor erstellten
HttpClient als Parameter injected bekommt. Dieser externe Accessor
wird von einem ExternalTaskApiClient benutzt um auf die ProcessEngine
zuzugreifen.
Zuletzt erstellen wir eine neue Instanz des ExternalTaskWorkers,
welcher die zuvor erstellte Instanz des ExternalTaskApiClients benutzt
um regelmäßig nach verfügbaren ExternalTasks zu schauen.
Einstellungen
Um den Worker mit der ProcessEngine zu verbinden, benötigen wir einige
zusätzliche Einstellungen.
const identity = {
  token: 'ZHVtbXlfdG9rZW4=',
};
const topicName = 'Chatbot';
const maxNumberOfTasksToGet = 10;
const longPollingTimeoutInMs = 10000;

Implementierung des Tasks
Zuletzt muss der Task implementiert und beim Worker registriert werden.
async function main() {

  const chatbot = new Chatbot();
  const chatbotResponse = async (externalTask) => {

    const humanRequest = externalTask.payload;

    const chatbotAnswer = chatbot.transform(humanRequest);
    return new ExternalTaskFinished(externalTask.id, chatbotAnswer);
  };

  externalTaskWorker.waitForAndHandle(
    identity,
    topicName,
    maxNumberOfTasksToGet,
    longPollingTimeoutInMs,
    chatbotResponse);
}

main();

Die Implementierung des Tasks liegt hierbei in der asynchronen Callback-Funktion:
const chatbotResponse = async (externalTask) => {

  const humanRequest = externalTask.payload;

  const chatbotAnswer = chatbot.transform(humanRequest);
  return new ExternalTaskFinished(externalTask.id, chatbotAnswer);
};

Laut Prozessmodellierung steht in externalTask.payload die Eingabe
des Nutzers.
chatbot.transform(humanRequest) generiert die Antwort des Chatbots.
return new ExternalTaskFinished(externalTask.id, chatbotAnswer);
gibt den Wert zurück. Er steht in der Prozessmodellierung als
Payload des ExternalTasks zur Verfügung.
Ausführung
Nun kann das Programm ausgeführt werden mit dem Befehl node
chatbot.js. Hierdurch wird lediglich der ExternalTask in dem
Diagramm ausführbar.
Der eigentliche Prozess wird anhand des Diagramms im BPMN-Studio
ausgeführt.

02_getting_started/examples/towers/move_.body:
Move Element-Diagramm
Die technische Grundlage für das Turmproblem ist die Möglichkeit das
oberste Element eines Turms auf einen anderen Turm (oder auf die
leere Position []) zu verschieben.
Diese Funktion modellieren wir mit dem Diagramm Move Element.

StartEvent
Dieses Diagramm wird über eine CallActivity aufgerufen. Normalerweise
wird bei Prozessstart ein neuer, leerer Token generiert.
Aber da dieser Prozess per CallActivity aufgerufen wird, wird das
Token beim StartEvent dieses Prozesses den letzten Tokenwert tragen,
welcher vor Aufruf der CallActivity bestand.

Für unsere Übersicht behaften wir das StartEvent mit einer
TextAnnotation, welche auf die erwarteten Startparameter verweist.
Expects:
{
  tower: Array>,
  fromIndex: number,
  toIndex: number,
}
Um komfortabel auf diese Startparameter zugreifen zu können, vergeben
wir eine neue ID startevent_arguments an das StartEvent.
ScriptTask Take element of one tower
Die eigentliche Funktionalität bewältigen wir mit ScriptTasks.

Wir hängen einen neuen ScriptTask an das StartEvent mit dem Namen
Take element of one tower und der ID scripttask_take_element.
Mit der return-Anweisung können wir den Token um einen Wert
anreichern. Da unser Programm aus mehr als einem Ausdruck besteht,
erstellen wir eine Funktion und führen diese unmittelbar aus.
Folgender Programmcode entfernt ein Element von dem Turm an der Stelle
fromIndex. Sowohl der aktualisierte Zustand der Türme, als auch das
entfernte Element werden zurückgegeben.
return (() => {
  const {tower, fromIndex} = token.history.startevent_arguments;
  const element = tower[fromIndex].pop();
  return {
      tower: tower,
      element: element,
  };
})();

Der Programmcode muss in das Feld Script im PropertyPanel eingefügt
werden.
ScriptTask Put element onto another tower
Wir erstellen einen weiteren ScriptTask mit dem Namen Put element
onto another tower. Wir müssen das zuvor entfernte Element noch auf
den Turm an der Stelle toIndex hinzufügen.
Hier fügen wir bei Script diesen Programmcode ein:
return (() => {
  const {tower, element} = token.history.scripttask_take_element;
  const {toIndex} = token.history.startevent_arguments;
  tower[toIndex].push(element);
  return tower;
})();

Der ScriptTask wird mit dem EndEvent verknüpft. Der Wert, der am
EndEvent ankommt, wird auch als Ergebnis der CallActivity
zurückgegeben.

07_apis_of_consumer_domain/01_consumer_a.body:
Einstieg
Um einen ersten Überblick in die Arbeitsweise mit der API zu erhalten, wird
hier ein Überblick über die Grundlegenden Routen und Parameter gegeben.
Tipp: Um bei den Abfragen Ergebnisse zu erhalten, muss mindestens ein
ausführbares Diagramm vorhanden sein.
Routen
Bei standardmäßiger Installation ist der API Server unter
http://localhost:8000 erreichbar.
Es müssen daher alle Routen in diesem Tutorial um die Serveradresse ergänzt
werden.
Beispiel:
GET /api/consumer/v1/process_models

entspricht
GET http://localhost:8000/api/consumer/v1/process_models

Alle Prozessmodelle abfragen
Die nachfolgende Abfrage zeigt alle Prozesse an, die den Kriterien unter
Auflisten startbarer Prozessmodelle
entsprechen.
GET /api/consumer/v1/process_models

Beispiel:
{
    "processModels": [
        {
            "id": "HelloWorld",
            "startEvents": [
                {
                    "id": "StartEvent_1mox3jl"
                }
            ],
            "endEvents": [
                {
                    "id": "EndEvent_0eie6q6"
                }
            ]
        }
    ]
}

Prozessmodell abfragen
Mehr Informationen unter Einzelnes Prozessmodell
abfragen
entsprechen.
GET /api/consumer/v1/process_models/:process_model_id

Beispiel:
GET /api/consumer/v1/process_models/HelloWorld

{
    "id": "HelloWorld",
    "startEvents": [
        {
            "id": "StartEvent_1mox3jl"
        }
    ],
    "endEvents": [
        {
            "id": "EndEvent_0eie6q6"
        }
    ],
    "xml": ""
}

Events anzeigen
GET /api/consumer/v1/process_models/:process_model_id/events

Beispiel:
GET /api/consumer/v1/process_models/HelloWorld/events

{
    "events": [
        {
            "id": "startEvent_1",
            "processInstanceId": "",
            "data": {}
        }
    ]
}

UserTasks anzeigen
GET /api/consumer/v1/process_models/:process_model_id/user_tasks

Beispiel:
GET /api/consumer/v1/process_models/HelloWorld/user_tasks

{
    "userTasks": [
        {
            "id": "Task_0k8m2if",
            "correlationId": "c5433825-ed03-4df4-b391-391e84b51f95",
            "processModelId": "HelloWorld",
            "data": {
                "formFields": [
                    {
                        "id": "Form_qJOQHD8n",
                        "label": "Log Message",
                        "type": "string",
                        "defaultValue": ""
                    }
                ]
            },
            "tokenPayload": {}
        }
    ]
}

Prozesse starten
Mehr Informationen unter Starten von Prozessinstanzen
 entsprechen.
POST /api/consumer/v1/process_models/:process_model_id/start_events/:start_event_id/start?start_callback_type=

Die Prozessinstanz wird gestartet und es wird bei callback_type

1 direkt geantwortet.
2 nach Prozessende geantwortet.
3 geantwortet wenn das angegeben EntEvent erreicht wurde.

Beispiel (callback_type = 1):
POST /api/consumer/v1/process_models/HelloWorld/start_events/StartEvent_1mox3jl/start?start_callback_type=1

{
    "correlationId": "d7703aff-f003-4d0a-bffb-f85de6b01fcc"
}

Beispiel (callback_type = 2):
Hinweis: Ergebnis erscheint erst nach Prozessende.
POST /api/consumer/v1/process_models/HelloWorld/start_events/StartEvent_1mox3jl/start?start_callback_type=2

{
    "correlationId": "c07a5301-d0dc-4a99-9d39-3ed07f17eff2",
    "endEventId": "EndEvent_0eie6q6",
    "tokenPayload": {
        "form_fields": {
            "Form_qJOQHD8n": "123"
        }
    }
}

Beispiel (callback_type = 3):
Hinweis: Ergebnis erscheint erst nach Prozessende.
